-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `user_num` varchar(20) NOT NULL COMMENT '用户的平台编号 TXB20081004xxxx',
  `open_id` varchar(255) NOT NULL COMMENT '微信用户唯一标识',
  `session_key` varchar(255) NOT NULL COMMENT 'code換回的session_key',
  `thr_session` varchar(255) NOT NULL COMMENT '自行生成的session_key',
  `nick_name` varchar(255) NOT NULL COMMENT '用户昵称，不重复',
  `user_sex` tinyint(4) DEFAULT '0' COMMENT '性别 男1 女2 未知0',
  `user_birth` int(10) DEFAULT NULL COMMENT '用户生日,10位时间戳',
  `user_headimg` varchar(255) NOT NULL COMMENT '用户头像',
  `user_phone` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `user_intro` text COMMENT '简介，可空',
  `school_id` int(11) DEFAULT '0' COMMENT '所属学校id',
  `post_status` int(4) NOT NULL DEFAULT '0' COMMENT '发贴权限 0 未激活 1 正常  2 冻结',
  `trade_status` int(4) NOT NULL DEFAULT '0' COMMENT '交易权限，0 未激活  1 正常  2 封禁',
